function normalizePacketItem(raw) {
  const item = { ...raw };
  if (!item.id) item.id = Date.now() + Math.floor(Math.random() * 1000);
  if (!item.type) item.type = 'node';
  if (typeof item.lat === 'string') item.lat = parseFloat(item.lat);
  if (typeof item.lng === 'string') item.lng = parseFloat(item.lng);

  // Backward/forward compatible channel support
  // - Older data only has freq/baud.
  // - Newer data may have channels: [{freq, baud, raw}, ...]
  // Ensure channels always exists and derive best-effort primary freq/baud.
  if (!Array.isArray(item.channels)) item.channels = [];

  // If only freq/baud exists, inject it into channels for consistent UI.
  if (item.channels.length === 0 && (item.freq || item.baud)) {
    item.channels = [{ freq: item.freq || '', baud: item.baud || '', raw: '' }];
  }

  // If freq/baud missing, derive from channels
  if ((!item.freq || !item.baud) && item.channels.length > 0) {
    const best = item.channels.find(c => (c && c.freq && c.baud)) || item.channels.find(c => (c && c.freq)) || null;
    if (best) {
      if (!item.freq && best.freq) item.freq = best.freq;
      if (!item.baud && best.baud) item.baud = best.baud;
    }
  }

  return item;
}

function validatePacketItem(item) {
  if (!item) return { ok: false, error: 'Missing item' };
  if (!['node', 'bbs'].includes(item.type)) return { ok: false, error: 'type must be node or bbs' };
  if (!item.callsign) return { ok: false, error: 'callsign is required' };
  if (!Number.isFinite(item.lat) || !Number.isFinite(item.lng)) return { ok: false, error: 'lat/lng must be numbers' };
  return { ok: true };
}

function getPacketNodesInRadius(centerLat, centerLng, radiusKm, nodes = packetNodeData) {
  return nodes.filter(n => {
    const d = calculateDistance(centerLat, centerLng, n.lat, n.lng);
    return d <= radiusKm;
  });
}

